import * as React from 'react';


export default function LoginPage() {
    return (
        <>
            <div className='center'>
                <h3 className='loginHeading' style={{textAlign: 'center'}}>Login</h3>
                <form>
                    <label>Username</label><br></br>
                    <input type='text'/>
                </form>
            </div>
        </>
    );
}
